INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('The living resources of the Chesapeake Bay from an ecosystem perspective. Designed for non-science majors, it will acquaint students with the Bay''s watershed, its physical environment, and its living organisms, with an emphasis on the connections between these factors. Understanding the relationships between physical, chemical and biological processes will equip students to comprehend and appreciate the remarkable productivity of our estuary, as well as provide them with the knowledge needed to protect the Bay. Course not acceptable toward major requirements in the College of Chemistry and Life Sciences.','187c888b-9ed4-42cb-abd1-bf76b52959ca','5db28fd4-b9bf-429d-9b6e-d95a58a93194','The living resources of the Chesapeake Bay from an ecosystem perspective. Designed for non-science majors, it will acquaint students with the Bay''s watershed, its physical environment, and its living organisms, with an emphasis on the connections between these factors. Understanding the relationships between physical, chemical and biological processes will equip students to comprehend and appreciate the remarkable productivity of our estuary, as well as provide them with the knowledge needed to protect the Bay. Course not acceptable toward major requirements in the College of Chemistry and Life Sciences.',0)
/
