INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('The Earth System operates through some fundamental cycles such as water, energy, and the Carbon Cycle. This course will build on GEOL/GEOG/AOSC123 starting with concept of feedbacks within the Earth System, global energy balance and the Greenhouse Effect. A brief introduction to the atmospheric and oceanic circulation will lead to the water cycle connecting the land, ocean, and atmosphere to the Earth System. Introduction to the Global carbon, nitrogen, and sulfur cycles will be followed by the concept of long-term climate regulation and short-term climate variability. The concepts of cycles, feedbacks,  forcings, and responses in the Earth System will be applied to Global Warming and Ozone Depletion.','483754a8-3635-44f3-9286-1cdd075acea7','d2a4731d-3836-464c-a950-9ec4215d398b','The Earth System operates through some fundamental cycles such as water, energy, and the Carbon Cycle. This course will build on GEOL/GEOG/AOSC123 starting with concept of feedbacks within the Earth System, global energy balance and the Greenhouse Effect. A brief introduction to the atmospheric and oceanic circulation will lead to the water cycle connecting the land, ocean, and atmosphere to the Earth System. Introduction to the Global carbon, nitrogen, and sulfur cycles will be followed by the concept of long-term climate regulation and short-term climate variability. The concepts of cycles, feedbacks,  forcings, and responses in the Earth System will be applied to Global Warming and Ozone Depletion.',0)
/
