INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('The specialization in Geographic Information Science is designed to give students the technical skills needed to acquire, manage and analyze geographic data. Almost everything we do involves geographic information: deciding where to live and travel, environmental monitoring, and urban planning. Influenced by computer technology, the academic disciplines of geographic information science such as remote sensing, Geographic Information Systems (GIS) and computer cartography have evolved dramatically in the past few decades. The fields of remote sensing, the science of obtaining geographic information from aircraft and satellites, and GIS, a computer technology that manages and analyzes different forms of digital geographic data, have been growing at an extraordinary rate. Computer cartography has revolutionized traditional cartography to vastly improve map making and visualization of geographic information in a multimedia environment. Students in the specialization will receive extensive training in digital processing of remote sensing observations and cartographic vector data, spatial analysis, and the display of information products.','84665e99-b091-4e31-b3c3-18e658f14a6c','ef42824e-e6cb-4996-9989-8f12c4686645','The specialization in Geographic Information Science is designed to give students the technical skills needed to acquire, manage and analyze geographic data. Almost everything we do involves geographic information: deciding where to live and travel, environmental monitoring, and urban planning. Influenced by computer technology, the academic disciplines of geographic information science such as remote sensing, Geographic Information Systems (GIS) and computer cartography have evolved dramatically in the past few decades. The fields of remote sensing, the science of obtaining geographic information from aircraft and satellites, and GIS, a computer technology that manages and analyzes different forms of digital geographic data, have been growing at an extraordinary rate. Computer cartography has revolutionized traditional cartography to vastly improve map making and visualization of geographic information in a multimedia environment. Students in the specialization will receive extensive training in digital processing of remote sensing observations and cartographic vector data, spatial analysis, and the display of information products.',0)
/
