INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('How do you see the future?  More of everything: food, parks, leisure, personal electronic devices, peace between the nations?  Or more people, new diseases, traffic gridlock, and starvation?<br>The world is changing at unprecedented rates, primarily as a result of human actions. Opportunities for increased well-being of humans and the environment abound. On the other hand competition for resources such as fresh water and oil is reaching crisis proportions.<br>The future of humanity depends on skillful management of our environment by planning the social, urban, suburban and rural settings where we work, live and play.  Expert care of the environment is needed to maintain supplies of food, natural products, water, and the other resources on which life depends. New insights into the social, economic and urban environment can help control poverty and crime.<br>Geography concerns the relations between people and the natural world, the effects of ecosystems on human beings and vice versa, the choices people make, the effects of past actions on people today, and the effects of today''s choices on future generations.','86335e1d-42f3-4ae1-b7a7-27532453dafc','0d0fee10-6a2c-40fc-87c0-6ec9ac3f48e2','How do you see the future?  More of everything: food, parks, leisure, personal electronic devices, peace between the nations?  Or more people, new diseases, traffic gridlock, and starvation?
The world is changing at unprecedented rates, primarily as a result of human actions. Opportunities for increased well-being of humans and the environment abound. On the other hand competition for resources such as fresh water and oil is reaching crisis proportions.
The future of humanity depends on skillful management of our environment by planning the social, urban, suburban and rural settings where we work, live and play.  Expert care of the environment is needed to maintain supplies of food, natural products, water, and the other resources on which life depends. New insights into the social, economic and urban environment can help control poverty and crime.
Geography concerns the relations between people and the natural world, the effects of ecosystems on human beings and vice versa, the choices people make, the effects of past actions on people today, and the effects of today''s choices on future generations.',0)
/
