INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('A ten-week resident summer institute at Goddard Space Flight Center for juniors, seniors and first-year graduate students interested in pursuing professional and leadership careers in aerospace-related fields. The national program includes research in a Goddard laboratory, field trips to NASA centers, and a combination of lectures and workshops on the mission, current activities and management of NASA. Students interested in the Academy will find information at http://nasa-academy.nasa.gov Application should be made by the end of January; sponsorship by an affiliated State Space Grant Consortium is customary, but not required.','e5e39be5-8c7e-46a0-8544-b35ed75682c7','f2b19f56-c98a-40e1-acbf-ce2d09c71417','A ten-week resident summer institute at Goddard Space Flight Center for juniors, seniors and first-year graduate students interested in pursuing professional and leadership careers in aerospace-related fields. The national program includes research in a Goddard laboratory, field trips to NASA centers, and a combination of lectures and workshops on the mission, current activities and management of NASA. Students interested in the Academy will find information at http://nasa-academy.nasa.gov Application should be made by the end of January; sponsorship by an affiliated State Space Grant Consortium is customary, but not required.',0)
/
