INSERT INTO KSLU_RICH_TEXT_T (FORMATTED,ID,OBJ_ID,PLAIN,VER_NBR) VALUES ('The Biological Sciences major offers a rigorous exposure to the modern experimental disciplines within Biology. The major is jointly offered by the Departments of Biology, Cell Biology & Molecular Genetics, and Entomology. All Biological Sciences majors complete a common sequence of introductory and supporting courses referred to as the Basic Program. In addition, students must complete an Advanced Program within one of the following specialization areas: Cell Biology & Genetics, Ecology & Evolution, General Biology, Microbiology, Physiology & Neurobiology, Individualized Studies.','ef78f0bb-29ee-4d98-8e40-e246a96037c9','5357a608-7567-4aa9-ab29-d7cdbfaf78cc','The Biological Sciences major offers a rigorous exposure to the modern experimental disciplines within Biology. The major is jointly offered by the Departments of Biology, Cell Biology & Molecular Genetics, and Entomology. All Biological Sciences majors complete a common sequence of introductory and supporting courses referred to as the Basic Program. In addition, students must complete an Advanced Program within one of the following specialization areas: Cell Biology & Genetics, Ecology & Evolution, General Biology, Microbiology, Physiology & Neurobiology, Individualized Studies.',0)
/
